import React, { Component } from 'react';
import AwesomeSlider from 'react-awesome-slider';
import { MdAddShoppingCart } from 'react-icons/md'

import { Container, ProductList, RegraLink } from '../home/styled'
import { GiBarracks } from "react-icons/gi";
import { GoCloudDownload, GoCreditCard, GoBell, GoDeviceDesktop } from "react-icons/go";

import Hearder from '../../components/Header'

class produtos extends Component {
  state = {
    products: [{
      id: 1,
      name: "Gta 6 (Augustingo carraca Version)",
      price: 299.00,
      image: "data:image/jpeg;base64,",
      description: "O melhor Jogo da Rockstar com o incrivel protagonista.."
    },
    {
      id: 1,
      name: "Bomba patch 2008",
      price: 299.00,
      image: "https://cdn.discordapp.com/attachments/732363484347760751/734111584640827402/link-trad.png",
      description: "O melhor Jogo da Rockstar com o incrivel protagonista.."
    },
    {
      id: 1,
      name: "Gta 6 (Augustingo carraca Version)",
      price: 299.00,
      image: "https://cdn.discordapp.com/attachments/732363484347760751/734111584640827402/link-trad.png",
      description: "O melhor Jogo da Rockstar com o incrivel protagonista.."
    },
    {
      id: 1,
      name: "Gta 6 (Augustingo carraca Version)",
      price: 299.00,
      image: "https://cdn.discordapp.com/attachments/732363484347760751/734111584640827402/link-trad.png",
      description: "O melhor Jogo da Rockstar com o incrivel protagonista.."
    },
    ],
  }

  render() {
    const { products } = this.state;
    return (
      <Container>
        <Hearder />

        <div id="bloco">
          <div id="barraLateral">

            <div id="carossel" />

            <div id="loja">
              <ProductList >
                {products.map(products => (

                  <li key={products.id} >
                    <img src={products.image} alt={products.name} />

                    <strong id="nome">{products.name}</strong>
                    <strong id="descricao">{products.description}</strong>
                    <span>{products.price}</span>

                    <button type="button" onClick={() => this.handleAddProduct(products)}>
                      <div>
                        <MdAddShoppingCart size={16} color="#FFF" />
                      </div>

                      <RegraLink to="/dog">

                        <span>ADICIONAR AO CARRINHO</span>

                      </RegraLink>
                    </button>

                  </li>

                ))}
              </ProductList>
            </div>



            <div id="icones1">
              <GiBarracks size={27} color="#fff" />
            </div>
            <div id="icones2">
              <GoCloudDownload size={27} color="#fff" />
            </div>
            <div id="icones3">
              <GoCreditCard size={27} color="#fff" />
            </div>
            <div id="icones4">
              <GoDeviceDesktop size={27} color="#fff" />
            </div>
            <div id="icones5">
              <GoBell size={27} color="#fff" />
            </div>
          </div>


        </div>
      </Container >
    )



  }

}

export default produtos;
